  if (typeof start === PrimitiveType.UNDEFINED) throw new Error("Missing required argument start");
  if (typeof stop === PrimitiveType.UNDEFINED) (start = 0), (stop = start);
  return Math.floor(Math.random() * (stop - start)) + start;
